DROP TABLE IF EXISTS `stock_trade`;
CREATE TABLE `stock_trade` (
  `FD_CODE` varchar(100) DEFAULT NULL COMMENT '股票代码',
  `FD_INFO` varchar(255) DEFAULT NULL COMMENT '股票信息',
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `TYPE` varchar(50) DEFAULT NULL COMMENT '交易类型:1-申购；0-赎回；',
  `BIZ_TP` varchar(100) DEFAULT NULL COMMENT '业务类型',
  `CONFIRM_AMT` double DEFAULT NULL COMMENT '确认金额(购买)',
  `CONFIRM_SHARE` double DEFAULT NULL COMMENT '确认份额',
  `TRADE_TIME` datetime DEFAULT NULL COMMENT '交易时间',
  `LAST_NET` double DEFAULT NULL COMMENT '最新净值',
  `CONFIRM_NET` double DEFAULT NULL COMMENT '确认净值',
  `NET_REDEM` double DEFAULT NULL COMMENT '赎回净值',
  `RK_ST_LOSS` double DEFAULT NULL COMMENT '风控-止损',
  `RK_ST_PROFIT` double DEFAULT NULL COMMENT '风控-止盈',
  `LAST_DATE` datetime DEFAULT NULL COMMENT '最新净值日期',
  `REDEM_SHARE` double DEFAULT NULL COMMENT '赎回份数',
  `SHARE_REDEM` double DEFAULT NULL COMMENT '赎回份额',
  `reason_buy` varchar(255) DEFAULT NULL COMMENT '买入理由',
  `reason_sell` varchar(255) DEFAULT NULL COMMENT '卖出理由',
  `reason_ex` varchar(255) DEFAULT NULL COMMENT '买卖经验',
  `conception` varchar(255) DEFAULT NULL,
  `NET_MAX_1` double DEFAULT NULL,
  `NET_MAX_7` double DEFAULT NULL,
  `NET_MAX_14` double DEFAULT NULL,
  `NET_MAX_30` double DEFAULT NULL COMMENT '最大净值最近30天',
  `NET_MAX_60` double DEFAULT NULL,
  `NET_MAX_90` double DEFAULT NULL COMMENT '最大净值最近n天',
  `NET_MAX_180` double DEFAULT NULL COMMENT '最大净值最近n天',
  `NET_MAX_360` double DEFAULT NULL COMMENT '最大净值最近n天',
  `NET_MIN_1` double DEFAULT NULL,
  `NET_MIN_7` double DEFAULT NULL,
  `NET_MIN_14` double DEFAULT NULL,
  `NET_MIN_30` double DEFAULT NULL COMMENT '最低净值',
  `NET_MIN_60` double DEFAULT NULL,
  `NET_MIN_90` double DEFAULT NULL,
  `NET_MIN_180` double DEFAULT NULL,
  `NET_MIN_360` double DEFAULT NULL,
  `DAY_NET_MAX` datetime DEFAULT NULL COMMENT '最高净值日期',
  `DAY_NET_MIN` datetime DEFAULT NULL COMMENT '最低净值日期',
  `ORDER_AMT` double DEFAULT NULL COMMENT '订单金额',
  `STATUS` varchar(50) DEFAULT NULL COMMENT '交易状态：1-确认成功',
  `ORDER_CODE` varchar(50) DEFAULT NULL COMMENT '订单编号',
  `REDEM_AMT` double DEFAULT NULL COMMENT '赎回金额',
  `EARN_AMT` double DEFAULT NULL COMMENT '收益金额',
  `CONFIRM_NET_DATA` varchar(20) DEFAULT NULL COMMENT '确认净值日期',
  `SERVER_CHARGE` double DEFAULT NULL COMMENT '手续费',
  `SERVER_CHARGE_REDEM` double DEFAULT NULL COMMENT '赎回手续费',
  `REDEM_STATUS` varchar(20) DEFAULT NULL COMMENT '赎回状态',
  `REDEM_TIME` datetime DEFAULT NULL COMMENT '赎回时间',
  `SOURCE` varchar(50) DEFAULT NULL COMMENT '交易渠道',
  `FD_ID` varchar(100) DEFAULT NULL COMMENT '股票ID',
  `ORDER_STATUS` varchar(10) DEFAULT NULL COMMENT '订单状态',
  `CREATE_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `UPDATE_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `NET_MIN_CLOS_1` double DEFAULT NULL,
  `NET_MIN_CLOS_7` double DEFAULT NULL,
  `NET_MIN_CLOS_14` double DEFAULT NULL,
  `NET_MIN_CLOS_30` double DEFAULT NULL,
  `NET_MIN_CLOS_60` double DEFAULT NULL,
  `NET_MIN_CLOS_90` double DEFAULT NULL,
  `NET_MIN_CLOS_180` double DEFAULT NULL,
  `NET_MIN_CLOS_360` double DEFAULT NULL,
  `NET_MAX_CLOS_1` double DEFAULT NULL,
  `NET_MAX_CLOS_7` double DEFAULT NULL,
  `NET_MAX_CLOS_14` double DEFAULT NULL,
  `NET_MAX_CLOS_30` double DEFAULT NULL,
  `NET_MAX_CLOS_60` double DEFAULT NULL,
  `NET_MAX_CLOS_90` double DEFAULT NULL,
  `NET_MAX_CLOS_180` double DEFAULT NULL,
  `NET_MAX_CLOS_360` double DEFAULT NULL,
  PRIMARY KEY (`ID`) USING BTREE,
  UNIQUE KEY `TRADE_TIME` (`TRADE_TIME`)
) ENGINE=InnoDB AUTO_INCREMENT=312 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='股票交易记录';

